import { Button } from "@mui/material";
import React, { useRef, useLayoutEffect, useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import logo from "../src/Utils";

const Home = () => {
  const navigate = useNavigate();
  const [pass, setPass] = useState([]);
  const location = useLocation();

  alert(logo);

  useEffect(() => {
    setPass(location.state.passwords);
  }, []);

  const unsafePasswords = (e) => {
    e.preventDefault();
    navigate("/UnsecurePassList", { state: { passwords: pass } });
  };

  const potentialPasswords = (e) => {
    e.preventDefault();
    navigate("/PotentialPassword");
  };

  const generateSecuredPasswords = (e) => {
    e.preventDefault();
  };

  return (
    <div
      style={{
        backgroundColor: "black",
        height: 840,
      }}
    >
      <img
        src={
          "https://igloodoor.s3.us-east-1.amazonaws.com/igloodoor%20logo.jpg?response-content-disposition=inline&X-Amz-Security-Token=IQoJb3JpZ2luX2VjEAQaCXVzLWVhc3QtMSJHMEUCIHYGjL6pah0IaURXi5PwC1C19neeUjF42d0tti9fPX77AiEA3zsWREZEIvdjzT6%2FCm4Tpx3P4TJT%2BxPKvBIyewMtfEcq7QIInf%2F%2F%2F%2F%2F%2F%2F%2F%2F%2FARAAGgw1ODMyODkzNzM0NTciDKzeJ7vD0s3J4ty4XSrBAm8qHlBU4Bh9iEBs3%2BtxnGey4af6q67gu867iAQjkssubpx49%2FDw0XSJN5r5cDEb4BfRLZwMF0BxAgO%2FJsGPLAwhDWiaZZGPwT0sDxbKtV%2FRolmDQWhSG7ujJIjw7q%2F%2F%2FB1Nv7N%2BLSGCj%2Fdby9MGlE3w5zt0HyseVO6Lep5rRSJSBg65YG%2FsaM65Mv0diYSGw%2Fkyfdmr70MypwD0fWGa3d7ZJyxuMksR%2FiM1h3dBtLpSxQtKdx6wEiHyDj8wdWQL5mXyJyjpSKwHRCdHc9KaACNByGeVJn02DwtunX3a1wr4NXdOIn9uGJ4i9rFtLulvUv107NJKv9KN8x8ow8gTxsj2oU2wpwJcd8YLuta6RrtLOLynnKVTTfZ%2BTUqk%2FSm6ineXkoDj8ILF0K40eA588pHZIFWJsWja8UHKy5EmNcchcDDZhbOSBjqzAk4mTNmB5%2F%2BfPzhcpetaIuyDtkWPcw2bvvekIZGbUbUrjhofPIhkjVcM%2FD0nhqKE1tsHPX8nkm4%2BaByxywV5B6zVykdgqHGnplmhSFihrUymUkA9F0eK9H%2FZWjm9U%2BNmnpKHqacmPxlA2MRBa3X8JmjPgwOKtYKpwImUkAgWF1DldxEOYiSHL7W9zOcaepEyEjmNi65J56zAtSRlIcMSXMcLvtcfdfh%2F1lSfbkxKxxzoGvxNSrMDhN1JlUlP9Nl%2F6hBu1OFAWGtPjxHEGSevBipya6ANK1pIHWuqxnGJHjn4n8swHLYfw6Pj%2B2QpoE2dEzVnlR3SIOAugH0oFeXm%2F8t3LUCjXSFtVPc5bLDGuhlYChPXDmJA%2B9CZUhK4XFStiYB1NM9Ay8JEh1FSvPOoIeOx3MM%3D&X-Amz-Algorithm=AWS4-HMAC-SHA256&X-Amz-Date=20220406T032450Z&X-Amz-SignedHeaders=host&X-Amz-Expires=300&X-Amz-Credential=ASIAYPTWBQMI5F4L4364%2F20220406%2Fus-east-1%2Fs3%2Faws4_request&X-Amz-Signature=89884d3ff9eb9e26ab3b08f0ef355aff7bfb61be75356491dfeddaa580846174"
